<script>
  import {onMount} from 'svelte';
  import ConfirmDialog from './ConfirmDialog.svelte';
  import { getPages, savePage, deletePage, saveNote, getNote } from './db';


  let pages=[];
  let currentPageIndex=0;
  let currentPageId = null;
  let title='';
  let note='';
  let isDeleteDialogOpen = false;
  let titleToDelete = '';
  let idToDelete = null;
 
onMount(async () => {
    pages = await getPages();
    if (pages.length > 0) {
      selectPage(0);
    } else {
      await addPage();
    }
  });

  async function saveCurrentNote() {
    if (currentPageId !== null) {
      await savePage(currentPageId, title);
      await saveNote(currentPageId, note);
      pages = await getPages(); 
      window.alert('Page is saved!');
    }
  }

  async function addPage() {
    const id = await savePage(null,'New Page');
    pages = await getPages();
    selectPage(pages.findIndex(page => page.id === id));
  }

  async function selectPage(index) {
    currentPageIndex = index;
    currentPageId = pages[currentPageIndex].id;
    title = pages[currentPageIndex].title;
    note = await getNote(currentPageId) || '';
  }

  function showDeleteDialog(page) {
    isDeleteDialogOpen = true;
    idToDelete = page.id;
    titleToDelete = page.title;
  }

  async function confirmDeletePage() {
    if (idToDelete !== null) {
      await deletePage(idToDelete);
      pages = await getPages();
      if (pages.length > 0) {
        currentPageIndex = Math.max(0, currentPageIndex - 1);
        selectPage(currentPageIndex);
      } else {
        await addPage();
      }
      isDeleteDialogOpen = false;
    }
  }


  function closeDeleteDialog() {
    isDeleteDialogOpen = false;
  }
</script>

<aside class="fixed top-0 left-0 z-40 w-60 h-screen">
  <div class="bg-gray-900 overflow-y-auto py-5 px-3 h-full border-r border-black">
    <ul class="space-y-2">
      {#each pages as page,index}
      <li class="flex justify-between items-center">
        <button on:click={()=>selectPage(index)} class="custom-padding {index==currentPageIndex ?'bg-gray-700' : ''} text-gray-300 rounded-lg w-full text-center border border-gray-800 ">{page.title}</button>
        <button on:click={() => showDeleteDialog(page)} class="font-bold text-3xl text-gray-400 hover:text-gray-300 ml-2">
          +
        </button>
      </li>
      {/each}
      <li class="text-center"><button on:click={addPage} class="font-medium text-gray-600 hover:text-gray-400">+ Add Pages</button></li>
    </ul>
  </div>
</aside>

<main class="bg-gray-700 p-4 ml-60 h-screen">
  <div class="grid grid-cols-2 items-center mb-3">
    <h1 class=" px-4 py-1.5 rounded-lg text-4xl font-bold" contenteditable bind:textContent={title} style="text-shadow: 2px 2px 4px rgba(211, 211, 211, 0.5);">
    </h1>
  </div>
  <hr class="border-t-2 border-gray-800">
<textarea  class=" mt-3 block w-full bg-gray-400 border border-gray-900 rounded-lg p-2.5" bind:value={note} placeholder="content" style="background-image:url('data:image/jpeg;base64,'); background-size: cover;"></textarea>
<button class="bg-gray-800 text-white px-5 py-2.5 rounded-lg font-medium text-sm mt-3 hover:bg-gray-900 border border-gray-600" on:click={saveCurrentNote}>SAVE</button>

{#if isDeleteDialogOpen}
<ConfirmDialog 
  title={titleToDelete} 
  on:confirm={confirmDeletePage} 
  on:cancel={closeDeleteDialog} 
/>
{/if}
</main>

